const NavBar = () => {
  return (
    <div className="flex">
      <div className="flex flex-row h-20 items-center gap-10 ">
        <div>
          <img src="" alt="" />
        </div>
        <div>
          <a href="">Home</a>
        </div>
        <div>
          <a href="">Upload</a>
        </div>
        <div>
          <a href="">Listings</a>
        </div>
      </div>
    </div>
  );
};

export default NavBar;
